    return(
        <div className="main-container">
      
       <div className="">
            <h4>Tongariro Cinemas is the oldest chain of multiplexes in New Zealand</h4>
          <p>We're committed to showing the best movies in the world.We have 4 theatres in our complex and screen old classics in 2 theatres and new releases in the other two.</p>
	    </div>

	 <div className="main">
	        <div className="container">
            
	            
                      <h3>Our Contact Details</h3>
                      <p> Address:-13B, Queen;s street, Newtown, Wellington</p>
	                  <p>  Email:tongariro_c@gmailcom</p>
	                  <p>Phone numbers-+64 22 314 4223; +64 21 333 7890</p>
           </div>
      </div>
     </div>

         
                    
);
}
               
	        
		

export default AboutAlt;
